import { Button } from 'react-rainbow-components';
import { useTheme } from "@mui/material";
import { tokens } from "../theme";
import styled from 'styled-components';

// Custom styled button with your desired color
const StyledButton = styled(Button)`
  background-color: ${({ theme }) => theme.rainbow.palette.brand};
`;

const Search = () => {
    const Mytheme = useTheme();
    const colors = tokens(Mytheme.palette.mode);
    const theme = {
        rainbow: {
            palette: {
                brand: colors.primary[300], // Change this to the desired color
                mainBackground: colors.primary[500],
                border: colors.primary[500],
                action: {
                    active: colors.primary[500],
                    hover: colors.primary[500],
                },
            },
        },
    };

    return (
        <div className="dash" style={{ paddingLeft: '20px' }}>
            <h1>Search</h1>
            <StyledButton label="Hello World!" variant="brand" onClick={() => alert('Hello World!')} theme={theme} />
        </div>
    )
}

export default Search;
